
import collections
class Solution(object):
    def shortestBridge(self, A):
        """
        :type A: List[List[int]]
        :rtype: int
        """
        if not A: return 0
        m,n = len(A), len(A[0])
       
        group1 = collections.deque()
        group2 = collections.deque()
        def dfs(i,j,group):
            
            A[i][j] = 2
            group.append((i,j))
                
            for dx, dy in [(0,1),(1,0),(-1,0),(0,-1)]:
                nx, ny = dx + i, dy + j
                if 0 <= nx < m and 0 <= ny < n and A[nx][ny] ==1:
                    dfs(nx,ny, group)
        
        groupidx = 0
        GROUPS = [group1, group2]
        for i in range(m):
            for j in range(n):
                if A[i][j] == 1:
                    dfs(i,j, GROUPS[groupidx])
                    groupidx +=1 
       
        # print(A, group1, group2)
        history1, history2 = set(),set()
        def explore(q,lvl,table,history):
            visted = set()
            tmp_length = len(q)
            for _ in range(tmp_length):
                i,j = q.popleft()
                for dx, dy in [(0,1),(1,0),(-1,0),(0,-1)]:
                    nx, ny = i + dx, j + dy
                    if 0 <= nx < m and 0 <= ny < n and table[nx][ny] ==0 :
                        q.append((nx,ny))                  
                        table[i][j] = 3
                        history.add((nx,ny))
            
            return q, lvl+1

        lvl1, lvl2 = 0,0
        table1, table2 = A[:], A[:]
        
        while True:
            group1,lvl1  =  explore(group1,lvl1,table1,history1)
            
            if history1.intersection(history2): return (lvl1-1) + (lvl2-1) +1
            group2, lvl2 = explore(group2,lvl2, table2,history2)
            
            if history1.intersection(history2): return (lvl1-1) + (lvl2-1) +1

            
        return -1

